import React from "react";
import StackGrid from "react-stack-grid";
import * as photos from "../assets/images/photos";

export const Photos = () => {
  <StackGrid
    columnWidth={"80%"}
  >
    {photos.forEach(photo => {
      <div>
        <img src={photo.path} alt=''/>
      </div>
    })}
  </StackGrid>
}
